import React, { useState, useEffect, useCallback } from 'react';
import {
  Grid,
  Paper,
  Typography,
  Box,
  TextField,
  Button,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  FormControlLabel,
  Switch,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Pagination,
  CircularProgress,
  IconButton,
  Tooltip,
  Alert,
} from '@mui/material';
import {
  Visibility as VisibilityIcon,
  Archive as ArchiveIcon,
  Feedback as FeedbackIcon,
  VisibilityOff as VisibilityOffIcon,
} from '@mui/icons-material';
import Layout from '../components/Layout';
import api from '../services/api';

const Vault = () => {
  const [entries, setEntries] = useState([]);
  const [loading, setLoading] = useState(true);
  const [page, setPage] = useState(1);
  const [totalPages, setTotalPages] = useState(1);
  const [selectedEntry, setSelectedEntry] = useState(null);
  const [feedbackDialog, setFeedbackDialog] = useState(false);
  const [showOriginal, setShowOriginal] = useState(false);
  const [feedback, setFeedback] = useState({
    is_positive: true,
    feedback_notes: '',
  });

  const fetchEntries = useCallback(async () => {
    try {
      const response = await api.get(`/mock/vault/mock`);
      setEntries(response.data);
      setTotalPages(Math.ceil(response.data.length / 10));
    } catch (error) {
      console.error('Error fetching vault entries:', error);
    } finally {
      setLoading(false);
    }
  }, []);

  useEffect(() => {
    fetchEntries();
  }, [fetchEntries]);

  const handleFeedbackSubmit = async () => {
    try {
      await api.post(`/mock/vault/feedback/${selectedEntry.id}`, {
        ...feedback,
        reviewed_by: 'current_user',
      });
      setFeedbackDialog(false);
      fetchEntries();
    } catch (error) {
      console.error('Error submitting feedback:', error);
    }
  };

  const handleArchive = async (entryId) => {
    try {
      await api.post(`/mock/vault/archive/${entryId}`);
      fetchEntries();
    } catch (error) {
      console.error('Error archiving entry:', error);
    }
  };

  const handleToggleVisibility = () => {
    setShowOriginal(!showOriginal);
  };

  if (loading) {
    return (
      <Layout>
        <Box sx={{ display: 'flex', justifyContent: 'center', mt: 4 }}>
          <CircularProgress />
        </Box>
      </Layout>
    );
  }

  return (
    <Layout>
      <Grid container spacing={3}>
        <Grid item xs={12}>
          <Typography variant="h4" gutterBottom>
            Vault
          </Typography>
        </Grid>

        <Grid item xs={12}>
          <Paper sx={{ p: 2 }}>
            <TableContainer>
              <Table>
                <TableHead>
                  <TableRow>
                    <TableCell>Message ID</TableCell>
                    <TableCell>Conversation ID</TableCell>
                    <TableCell>User ID</TableCell>
                    <TableCell>Status</TableCell>
                    <TableCell>Date</TableCell>
                    <TableCell>Actions</TableCell>
                  </TableRow>
                </TableHead>
                <TableBody>
                  {entries.map((entry) => (
                    <TableRow key={entry.id}>
                      <TableCell>{entry.message_id}</TableCell>
                      <TableCell>{entry.conversation_id}</TableCell>
                      <TableCell>{entry.user_id}</TableCell>
                      <TableCell>
                        {entry.is_archived ? 'Archived' : 'Active'}
                      </TableCell>
                      <TableCell>
                        {new Date(entry.created_at).toLocaleString()}
                      </TableCell>
                      <TableCell>
                        <Tooltip title="View Details">
                          <IconButton
                            onClick={() => {
                              setSelectedEntry(entry);
                              setFeedbackDialog(true);
                            }}
                          >
                            <VisibilityIcon />
                          </IconButton>
                        </Tooltip>
                        {!entry.is_archived && (
                          <>
                            <Tooltip title="Archive">
                              <IconButton
                                onClick={() => handleArchive(entry.id)}
                              >
                                <ArchiveIcon />
                              </IconButton>
                            </Tooltip>
                            <Tooltip title="Provide Feedback">
                              <IconButton
                                onClick={() => {
                                  setSelectedEntry(entry);
                                  setFeedbackDialog(true);
                                }}
                              >
                                <FeedbackIcon />
                              </IconButton>
                            </Tooltip>
                          </>
                        )}
                      </TableCell>
                    </TableRow>
                  ))}
                </TableBody>
              </Table>
            </TableContainer>
            <Box sx={{ display: 'flex', justifyContent: 'center', mt: 2 }}>
              <Pagination
                count={totalPages}
                page={page}
                onChange={(e, value) => setPage(value)}
                color="primary"
              />
            </Box>
          </Paper>
        </Grid>
      </Grid>

      {/* Feedback Dialog */}
      <Dialog
        open={feedbackDialog}
        onClose={() => {
          setFeedbackDialog(false);
          setShowOriginal(false);
        }}
        maxWidth="md"
        fullWidth
      >
        <DialogTitle>
          {selectedEntry ? 'Review Redaction' : 'View Details'}
        </DialogTitle>
        <DialogContent>
          {selectedEntry && (
            <>
              <Box sx={{ mb: 2, mt: 2 }}>
                <Typography variant="subtitle1" gutterBottom>
                  Message Content:
                </Typography>
                <Paper 
                  sx={{ 
                    p: 2, 
                    backgroundColor: showOriginal ? '#fff3e0' : '#f5f5f5',
                    position: 'relative' 
                  }}
                >
                  <Typography variant="body1" component="div" sx={{ whiteSpace: 'pre-wrap' }}>
                    {showOriginal ? selectedEntry.original_message : selectedEntry.redacted_message}
                  </Typography>
                  <IconButton
                    onClick={handleToggleVisibility}
                    sx={{
                      position: 'absolute',
                      top: 8,
                      right: 8,
                    }}
                  >
                    {showOriginal ? <VisibilityOffIcon /> : <VisibilityIcon />}
                  </IconButton>
                </Paper>
                {showOriginal && (
                  <Alert severity="warning" sx={{ mt: 1 }}>
                    You are viewing the original message with sensitive information. Handle with care.
                  </Alert>
                )}
              </Box>
              <Box sx={{ mb: 2 }}>
                <Typography variant="subtitle1" gutterBottom>
                  Redaction Details:
                </Typography>
                <Grid container spacing={2}>
                  <Grid item xs={6}>
                    <Paper sx={{ p: 2 }}>
                      <Typography variant="body2" color="text.secondary">
                        Confidence Score
                      </Typography>
                      <Typography variant="h6">
                        {(selectedEntry.confidence_score * 100).toFixed(1)}%
                      </Typography>
                    </Paper>
                  </Grid>
                  <Grid item xs={6}>
                    <Paper sx={{ p: 2 }}>
                      <Typography variant="body2" color="text.secondary">
                        Redactions Found
                      </Typography>
                      <Typography variant="h6">
                        {selectedEntry.redaction_count}
                      </Typography>
                    </Paper>
                  </Grid>
                </Grid>
              </Box>
              <FormControlLabel
                control={
                  <Switch
                    checked={feedback.is_positive}
                    onChange={(e) =>
                      setFeedback({ ...feedback, is_positive: e.target.checked })
                    }
                  />
                }
                label={feedback.is_positive ? "Redaction is correct" : "Redaction needs improvement"}
              />
              <TextField
                fullWidth
                multiline
                rows={4}
                label="Feedback Notes"
                value={feedback.feedback_notes}
                onChange={(e) =>
                  setFeedback({ ...feedback, feedback_notes: e.target.value })
                }
                sx={{ mt: 2 }}
                placeholder="Provide specific feedback about the redaction..."
              />
            </>
          )}
        </DialogContent>
        <DialogActions>
          <Button 
            onClick={() => {
              setFeedbackDialog(false);
              setShowOriginal(false);
            }}
          >
            Cancel
          </Button>
          <Button onClick={handleFeedbackSubmit} variant="contained" color="primary">
            Submit Feedback
          </Button>
        </DialogActions>
      </Dialog>
    </Layout>
  );
};

export default Vault;
